import React from 'react'

const Tab = ({ mapping, search }) => {


    const keys = ['name', 'email']





    return (
        <div>
            <table>
                <tr>
                    <th>Name</th>
                    <th>Email</th>
                 
                </tr>
                {
                    mapping.filter((item) =>
                        keys.some((elem) => item[elem].toLowerCase().includes(search)))
                        .map(tab => {
                            return <tr key={tab.id} >
                                <td> {tab.name} </td>
                                <td> {tab.email} </td>
                            </tr>
                        })
                }
            </table>
        </div>
    )
}

export default Tab
